import { NavLink, useNavigate } from 'react-router-dom'
import { useContext } from 'react'
import { UserContext } from '../App'

function Nav () {
    const {user, logout} = useContext(UserContext)
    return (
        <>
            <h1 className='text-6xl'>UMAMI</h1>

            {
            user ? 
            <div className='text-2xl hover:text-green-200'>
                <NavLink id='link' to='/cookbook' className='nav-link' > Cookbook </NavLink>
                <NavLink id='link' to='/findrecipes' className='nav-link' > Find Recipe </NavLink>
                <NavLink id='link' to='/profile' className='nav-link'  > Profile </NavLink>
                <NavLink id='link' to='/' className='nav-link' onClick={logout} > Logout </NavLink>
            </div>
            :
                <></>
         }


        </>
    )
}

export default Nav
